    <ContainedButton variant="contained" color="secondary" sx={{marginRight: "24px"}}>Contact Now</ContainedButton>
    <OutlinedButton variant="outlined" color="secondary">Learn More</OutlinedButton>
  </div>
  <img src={robot} alt="Robot" className={classes["banner-image"]}/>
</div>
  )
};

export default TopBanner;
